import NameItem from "./NameItem";
import styles from "./Name.module.css";

const Name=(props)=>{
   
    return (<div>
       <ul>
        {props.items.map((expense) => <NameItem
            key={expense.id}
            title={expense.title}
            amount={expense.amount}
            date={expense.date}
          />
        )}
        </ul>
    </div>)
}
export default Name;
